game.showLongText("Break as many tiles as possible! Keep the ball alive!", DialogLayout.Bottom)
startGame()
game.onUpdate(function () {
    if (startBallVar == 0) {
        ballvar.setPosition(paddle.x, 105)
        ballvar.setVelocity(0, 0)
        if (controller.A.isPressed()) {
            startBallVar = 1
        }
    }
    if (startBallVar == 1) {
        ballvar.setVelocity(Math.randomRange(-30, 30), -50)
        startBallVar = 2
    }
})
